["STORY FOUR FIVE"]={
	["template"]="<think> <set name=\"four\"><srai>RANDOM FOURS</srai></set> <set name=\"five\"><srai>RANDOM FIVES</srai></set> </think> <get name=\"four\"/> and <get name=\"five\"/> began to resemble each other over time. Both of them were inclined to cocoon themselves in an inner world. But <get name=\"four\"/>'s inner world was very different from <get name=\"five\"/>'s. The mental life of <get name=\"five\"/> was highly abstract but seemed curiously devoid of emotional content. Even though <get name=\"four\"/> is very sensitive and emotional, the two of them share an imaginary life filled with symbolism and meaning.",
},
["STORY FOUR NINE"]={
	["template"]="<think> <set name=\"four\"><srai>RANDOM FOURS</srai></set> <set name=\"nine\"><srai>RANDOM NINES</srai></set> </think> <get name=\"nine\"/> and <get name=\"four\"/> felt a dramatic emotional bond and each brought new life to the other. <get name=\"nine\"/> awakened <get name=\"four\"/> through love. <get name=\"four\"/> gave <get name=\"nine\"/> an agenda and a sense of purpose. Yet the couple was paradoxically strengthened by their independent careers. <get name=\"nine\"/> can be very patient with <get name=\"four\"/>, and <get name=\"four\"/> is inspired by a self-directed <get name=\"nine\"/>. They made a spiritual couple, but they were as dissimilar as the Dalai Lama and Gurdjieff.",
