["WHALE TALE"]={
	["template"]="<get name=\"whale\"/>s are so beloved that the authorities spent four months and $250,000 unsuccessfully trying to free a <get name=\"right\"/> dubbed Churchill from fishing ropes last year, and the stranding of 55 <get name=\"pilot\"/>s near here a few weeks ago prompted a lump in the national throat. The \"Save the <get name=\"whale\"/>s\" ethos is almost unquestioned, and <get name=\"badboys\"/> and <get name=\"badgirls\"/> risk becoming pariahs by continuing to salivate when they see a nice juicy <get name=\"whale\"/>. But it's time to put sentiment aside. The \"save the <get name=\"whale\"/>s\" campaign against all commercial <get name=\"whal\"/>ing was necessary a few decades ago, after <get name=\"whal\"/>ing had devastated all large species. Even today, there are fewer than 10,000 <get name=\"blue\"/>s worldwide, compared with 200,000 before they were hunted, and <get name=\"right\"/>s may become extinct. But it is equally true that restrictions on <get name=\"whal\"/>ing, including a moratorium on all commercial <get name=\"whal\"/>ing since 1986, have led to a sharp rebound in some <get name=\"whale\"/> stocks. The U.S. National <get name=\"whale\"/> Service estimated in 2000 that there are more than two million <get name=\"sperm\"/>s worldwide. The International <get name=\"whal\"/>ing Commission calculated years ago that there were more than 900,000 <get name=\"minke\"/>s and 780,000 <get name=\"pilot\"/>s worldwide, and the numbers are higher now. Milton <get name=\"whale\"/>man, a <get name=\"whal\"/>ing expert at the University of Alberta, estimates that the number of <get name=\"minke\"/>s has trebled over 30 years and that <get name=\"humpbacks\"/> are exploding at a rate of 12 to 17 percent annually. Indeed, the number of <get name=\"gray\"/>s (which came off the endangered species list in 1994) surged so much in the late 1990's that hundreds of dead ones began washing up on West Coast beaches, so emaciated that their ribs showed. The best guess is that the numbers of <get name=\"gray\"/> grew, the food supply shrank and Malthus had his way. The bottom line is that while most large <get name=\"whale\"/>s remain at risk, for some species we can no longer argue that we need to \"save the <get name=\"whale\"/>s.\" They've been saved. At a time when there's talk about over<get name=\"whal\"/>ing, it's also worth pointing out that <get name=\"whale\"/>s now eat at least 300 million tons of marine life, three times as much as humans. There is speculation that rising numbers of <get name=\"minke\"/>s may be holding down the population of <get name=\"blue\"/>s that compete for similar food.",
},
